import AssetActionTypes from "./asset.types";

const INITIAL_STATE = {
  comments: null,
  id: null,
  image: null,
  last_checkout: null,
  model: null,
  name: null,
  owner_id: null,
  serial: null,
  status: null,
}

// eslint-disable-next-line import/no-anonymous-default-export
const assetData = (state = INITIAL_STATE  , action) => {
  switch (action.type) {
    case AssetActionTypes.RECEIVE_SELECTED_ASSET:
      console.log(action.payload)
      if(action.payload === undefined){
        return state;
      }
      return {
        ...state,
        asseData: action.payload
        // assetId: action.payload.id
        // comments: null,
        // id: null,
        // image: null,
        // last_checkout: null,
        // model: null,
        // name: null,
        // owner_id: null,
        // serial: null,
        // status: null,
      };
    default:
      return state;
  }
};

export default assetData;
